const styles = {
  root: {
    display: 'flex',
    justifyContent: 'center',
    width: '100%',
    backgroundColor: '#121212',
  },
  bar: {
    paddingTop: 20,
    textAlign: 'center',
    backgroundColor: '#121212',
    color: 'white',
  },
};

export default styles;
